import { BlockItem } from "./BlockItem/BlockItem";
import { Container } from "../Container/Container";
export const BlockInfo = ({ title, arrayItem }: { title?:string, arrayItem?:any} ) => {
  const blockRef = React.useRef<any
  return <div className={style.blockinfo}>
    <Container>
      <div className={style.block_container}>
        <div className={style.block_title}>
          <h2>{title}</h2>
          <h4>Смотреть все</h4>
        </div>
        <div className={style.block_items}>
          <BlockItem></BlockItem>
          <BlockItem></BlockItem>
          <BlockItem></BlockItem>
          <BlockItem></BlockItem>
        </div>
        <img className={style.img_pagin} src="../assets/nav.png" alt="" />
      </div>
    </Container>
  </div>;
};
